import React, { Component } from 'react'

export class Todo_Item extends Component {
  render() {
    return (
      <div>
            
            <h3>{this.props.todo.title}</h3>
            <p>{this.props.todo.desc}</p>
        
      </div>
    )
  }
}

export default Todo_Item
